import styles from "./Navigation.module.css";

const ListItem = () => {
  return <li className={styles.list}>Investments</li>;
};

const Navigation = () => {
  return (
    <>
      <nav>
        <ul className={styles.lists}>
          <li className={styles.list}>Home</li>
          <li className={styles.list}>Investments</li>
          <li className={styles.list}>Who are we</li>
          <li className={styles.list}>Contact Us</li>
        </ul>
      </nav>
    </>
  );
};

export default Navigation;
